const initState = {
    allUsers:""
    }


    const AllUsersReducer = (state=initState, action) =>{
        switch(action.type){

            case 'LOADING':
                return {
                    ...state,
                    allUsers:'loading'
                }

            case 'LOAD_USERS_SUCCESS':
                console.log(action)
                return {
                    ...state,
                    allUsers:action.res,
                }

            case 'LOAD_USERS_ERROR':
                console.log(action)

                return {
                    ...state,
                    allUsers:action.res,
                }

            case 'CODE_ERROR':
                    console.log(action)
                    return {
                        ...state,
                        allUsers:'there seems to be a problem please refresh your browser',
                    }


            default:
                return state

            }
    }

    export default AllUsersReducer;
